        //合并打印html
        function printPreviewHtml(){
            let ctl = document.getElementById("myWriterControl");
            var options = {
                Files: [
                    [xml],
                    [xml],
                    [xml]
                ],
                UseBase64: "false",
                WaterMark: {
                    Type: "Text",
                    Text: "aaaaaaaaaaa",
                    Repeat: "True",
                    ImageDataBase64String: null,
                    Font: "Tahoma, 12, style=Italic",
                    DensityForRepeat: "0.2",
                    ColorValue: "#1A3E72",
                    BackColorValue: "White",
                    Angle: "30",
                    Alpha: "80"
                }
            }
            var printHtml = ctl.GetPrintPreviewHTMLByMixedFiles(options);
            ctl.PrintPreviewByHtml(printHtml);
        }

        function PrintCurrentPage() {
            let ctl = document.getElementById("myWriterControl");
            let CreatePrintOptions =
            {
                CleanMode: true,// 默认为空，是否为整洁打印模式，可选值为true:整洁打印，false:留痕打印，空：采用编辑器当前的留痕显示设置。
                PrintRange: "CurrentPage",// 默认AllPages,打印范围，为一个字符串，可以为 AllPages,Selection,SomePages,CurrentPage
                PrintMode: "Normal",// 默认Normal,打印模式，为一个字符串，可以为 Normal,OddPage,EvenPage。这里的页码是从0开始计算的。
                Collate: true,// 默认false,是否为逐份打印，为一个布尔值
                Copies: 1,// 默认1,打印份数，为一个整数。
                FromPage: 0, // 默认0，从0开始计算的打印开始页码，只有PrintRange=SomePages时本设置才有效
                ToPage: 1,//默认为总页数, 从0开始计算的打印结束开始页码，只有PrintRange=SomePages时本设置才有效
                SpecifyPageIndexs: "1"//默认空，打印指定页码列表，页码从0开始计算，各个项目之间用逗号分开，如果项目中间有个横杠，表示一个页码范围
            };


            ctl.PrintDocument(CreatePrintOptions);
        }

                Collate: true,// 默认false,是否为逐份打印，为一个布尔值

        function SelectionPrint() {
            let ctl = document.getElementById("myWriterControl");

        }
        function BoundsSelectionPrint() {
            let ctl = document.getElementById("myWriterControl");
            let CreatePrintOptions =
            {
                CleanMode: true | false | null,// 默认为空，是否为整洁打印模式，可选值为true:整洁打印，false:留痕打印，空：采用编辑器当前的留痕显示设置。
                PrintRange: "AllPages" | "Selection" | "SomePages" | "CurrentPage",// 默认AllPages,打印范围，为一个字符串，可以为 AllPages,Selection,SomePages,CurrentPage
                PrintMode: "Normal" | "OddPage" | "EvenPage",// 默认Normal,打印模式，为一个字符串，可以为 Normal,OddPage,EvenPage。这里的页码是从0开始计算的。
                Collate: true,// 默认false,是否为逐份打印，为一个布尔值
                Copies: 1,// 默认1,打印份数，为一个整数。
                FromPage: 0, // 默认0，从0开始计算的打印开始页码，只有PrintRange=SomePages时本设置才有效
                ToPage: 1,//默认为总页数, 从0开始计算的打印结束开始页码，只有PrintRange=SomePages时本设置才有效
                SpecifyPageIndexs: "1,3,6-11,12",//默认空，打印指定页码列表，页码从0开始计算，各个项目之间用逗号分开，如果项目中间有个横杠，表示一个页码范围
                BodyLayoutOffset: 0,// 默认为0，正文偏移续打的纵向偏移量
                JumpPrintStartElementID: null,// 续打开始处的文档元素编号，若该属性值有效，则续打开始位置为该指定ID的元素的上边缘。
                JumpPrintEndElementID: null,// 续打结束处元素编号，若该属性值有效，则结束处续打的开始位置为指定ID的元素的下边缘。
                JumpPrint: { // 续打信息
                    PageIndex: 0,// 从0开始计算的续打开始的页码
                    Position: 0,// 开始续打的位置
                    EndPageIndex: 0,// 从0开始计算的下端续打的页码
                    EndPosition: 0// 下端续打的位置
                }
            };
            ctl.PrintDocument(CreatePrintOptions);
        }
        function JumpPrint() {

                PrintRange: "AllPages",// 默认AllPages,打印范围，为一个字符串，可以为 AllPages,Selection,SomePages,CurrentPage
                PrintMode: "Normal",// 默认Normal,打印模式，为一个字符串，可以为 Normal,OddPage,EvenPage。这里的页码是从0开始计算的。
                Collate: true,// 默认false,是否为逐份打印，为一个布尔值
                Copies: 1,// 默认1,打印份数，为一个整数。
                FromPage: 0, // 默认0，从0开始计算的打印开始页码，只有PrintRange=SomePages时本设置才有效
                ToPage: 1,//默认为总页数, 从0开始计算的打印结束开始页码，只有PrintRange=SomePages时本设置才有效
                SpecifyPageIndexs: "1,3,6-11,12",//默认空，打印指定页码列表，页码从0开始计算，各个项目之间用逗号分开，如果项目中间有个横杠，表示一个页码范围
                JumpPrint: { // 续打信息
                    PageIndex: 0,// 从0开始计算的续打开始的页码
                    Position: 555,// 开始续打的位置
                    EndPageIndex: 1,// 从0开始计算的下端续打的页码
                    EndPosition: 1000// 下端续打的位置
                }
            };
            ctl.PrintDocument(CreatePrintOptions);
        }

        /**
         * 控件加载完毕后会自动执行名为 WriterControl_OnLoad 的函数.该函数内的this变量指向HTML根元素
         * @param { WriterControl } rootElement
         */
        function WriterControl_OnLoad(rootElement) {
            console.log('WriterControl_OnLoad')

            rootElement.SelectionChanged = function (eventSender, args) {
                var txt =
                    "第" + (this.FocusedPageIndexBase0 + 1) + "页,第" +
                    this.CurrentLineIndexInPage + "行，第" +
                    this.CurrentColumnIndex + "列.";
                if (this.SelectionLength != 0) {
                    txt = txt + "选择了" +
                        Math.abs(this.SelectionLength) + "个元素";
                }
                var p = this.SelectionStartPosition;
                txt = txt + " X:" + p.x + " Y:" + p.y;
                document.getElementById('lblStatus').innerText =
                    txt + " 当前字体:" + this.CurrentFontName + "," + this.CurrentFontSize;
            };
            rootElement.DocumentLoad = function (eventSender, args) {
                //LogHightTime("文件加载完毕");
            };
            rootElement.EventShowContextMenu = Handle_EventShowContextMenu;// 这个函数定义在DemoApp.js中
            rootElement.EventUpdateToolarState = Handle_EventUpdateToolarState;// 这个函数定义在DemoApp.js中
        };
